webpackJsonp([0xf9a1f4bbd348],{2449:function(e,t){e.exports={data:{markdownRemark:{html:'<p>At that time (when I was in high school), Sue Dr. Sue who was wearing a mathematical teaching portrait of Mr. G (pseudonym). I drew it in the image of the brain, not something that was photographed, but I remember being terribly alright when I looked at the face again.</p>\n<p>A picture created as illustration for setting " <a href="/2898">JIJIHAZARD</a> " that was produced by classmate <a href="http://mixi.jp/show_friend.pl?id=2308126">Butterbean</a> at the time.</p>\n<p>Even now, I will never forget the super-expansion of the lesson on that day ...... Mr. G who is writing earthly objects on the chalkboard which is not visible very much like an earthworm crawling.</p>\n<ol>\n<li>Teacher "Hey, Maku, do you understand this problem?"</li>\n<li>Maku: I can not read how it\'s written.</li>\n<li>Teacher "Bacaoya! Elementary school students can do it!</li>\n</ol>',frontmatter:{cover:null,date:"1997-10-01T00:00:00+09:00",strDate:"1997/9/30",title:"Ms. G"}}},pathContext:{path:"/en/blog/1997/10/01-mr-g/",langKey:"en"}}}});
